// The "App.js" is our ROOT component which means its the main component being rendered in our starting file (the "index.js" file).
// All other components that we create will be nested inside the "App.js" file.

function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <p>You got dis Easyy!!!</p>
    </div>
  );
}

export default App;
